import React from 'react';
//Styles imports
import {Navbar} from 'react-bootstrap'
import {NavLink} from 'react-router-dom'

const NaviBar = ({}) => (
  <Navbar inverse>
    <Navbar.Header>
      <Navbar.Brand>
        UN
      </Navbar.Brand>
    </Navbar.Header>
  </Navbar>

);

export default NaviBar;
